import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import '../static/tickets.css';
import Footer from './Footer';
export default function Dashboard () {
  const navigate = useNavigate();
  const [user, setUser] = useState({});
  const FetchUser = async () => {
    try {
        	const response = await fetch('http://127.0.0.1:5000/api/info', {
		     		headers: {
			     		Authorization: `Bearer ${localStorage.getItem('access_token')}`
		     		}
      });
      const data = await response.json();
    } catch (err) { console.err(err); }
  };
  const Logout = () => {
	  fetch('http://127.0.0.1:5000/api/logout', {
      method: 'DELETE',
      headers: {
        Authorization: `Bearer ${localStorage.getItem('access_token')}`
      }
    }).then(response => {
		  localStorage.removeItem('access_token');
		  navigate('/');
      return response.json();
    }).then(jsondata => jsondata).catch(err => console.error(err));
  };
  const Signout = () => {
    fetch('http://127.0.0.1:5000/api/signout', {
      method: 'POST',
      headers: {
        Authorization: `Bearer ${localStorage.getItem('access_token')}`
      }
    }).then(response => {
		 localStorage.removeItem('access_token');
      navigate('/');
      return response.json();
    }).then(jsondata => console.log(jsondata));
  };
  const ticketData = [
    {
      id: 'CIN1',
      movie: 'The Lion King',
      cinema: 'AMC Theatres',
      // date: '2023-06-12',
      // time: '18:00',
      booking_id: '456',
      price: 10.0,
      seat_number: 'B2'
    },
    {
      id: 'CIN32',
      movie: 'The Lion King',
      cinema: 'AMC Theatres',
      // date: '2023-06-12',
      // time: '18:00',
      booking_id: '123',
      price: 10.0,
      seat_number: 'B2'
    }
  ];
  const putData = (item) => {
    fetch('http://127.0.0.1:5000/api/tickets', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
		        Authorization: `Bearer ${localStorage.getItem('access_token')}`
      },
      body: JSON.stringify(item)
    }).then(response => {
		 console.log(response.status);
      return response.json();
    }).then(jsondata => console.log(jsondata));
  };
  useEffect(() => {
    for (const item of ticketData) {
    	putData(item);
    }
  }, []);
  return (
    <>
      <header>
        <div className='logo'><i className='fas fa-user-circle user-icon' />Hi, user</div>
        <nav>
          <ul>
            <li><Link to='/'>home</Link></li>
            <li onClick={Signout} style={{ cursor: 'pointer' }}>signout</li>
            <li onClick={Logout} style={{ cursor: 'pointer' }}>logout</li>
          </ul>
        </nav>
      </header>
      <div className='tickets-container'>
        <div className='tickets'>
          <h2>My Tickets<i className='fas fa-ticket-alt ticket-icon' /></h2>
          <p>View all tickets you have booked</p>
        </div>
        <div className='table-wrapper'>
          <table className='ticket-table'>
            <thead>
              <tr>
                <th>Ticket ID</th>
                <th>Date</th>
                <th>Time</th>
                <th>Payment</th>
                <th>Seat Number</th>
                <th>Ticket</th>
                {/* Add additional table headers as needed */}
              </tr>
            </thead>
            <tbody>
              {ticketData.map((ticket) => (
                <tr key={ticket.id}>
                  <td>{ticket.id}</td>
                  <td>{ticket.date}</td>
                  <td>{ticket.time}</td>
                  <td>{ticket.price}</td>
                  <td>{ticket.seat_number}</td>
                  <td><button
                    className='ticket-button' onClick={() => {
		  localStorage.setItem('ticket', ticket.id);
                    }}
                      >View
                      </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
      <Footer />
    </>
  );
}
